import Vue from 'vue'
import App from './App.vue'
import router from './router'
import vuetify from './plugins/vuetify'

Vue.config.productionTip = false

Vue.filter('touppercase',function(value) {
  return value.charAt(0).toUpperCase()

})

new Vue({
  router,
  vuetify,
  render: h => h(App)
}).$mount('#app')
